let defaultSaturation=75,defaultLightness=58,defaultAlpha=1;function updateRandomColor(){let o=document.querySelectorAll("[data-background_color='random']");for(let a of o)a.style.backgroundColor=randomHSLColor()}function randomHSLColor(){return"hsla("+Math.floor(360*Math.random())+", "+defaultSaturation+"%, "+defaultLightness+"%, "+defaultAlpha+")"}